INSERT INTO `dof_actions` VALUES (20,19,3,1,'DÖF oluşturuldu',NULL,NULL,'2025-06-17 13:28:11'),(21,19,2,2,'DÖF Emaar Şube departmanına atandı: Tezgahta yer alan ürünlerin değerlendirilmesi ile oluşan duyusal uygunsuzluk için gerekli aksiyon planlaması yapılmalıdır.',2,3,'2025-06-17 13:31:04'),(22,19,12,2,'Merhabalar hardallı patates Ürünün  raf ömrü 12.06.2025 ürün +2 derece ile sabah 10:00 da tezgaha açılmıştır üründe duyusal yapılmıştır herhangi bi problem  olmamıştır. gün içerisinde ürün sürekli olarak yenilenerek tezgaha konulmuştur. Et yemeği olarak o gün domates soslu etimiz vardı skt olarak raf ömrü 10.06.2025 dir herhangi bi misafirimizden  ürün hakkında kötü bi dönüş olmadı sözlü olarak. tezgahta ürün duyusalı yapılmıştır. ürünün sert olması ısınma süresi ile ilgili olabilme ihtimali olabilir, bazı misafirlerimiz ürünün fazla ısıtılmasını talep ediyor, ürün 260 derece ile ısındığı için üzerinde kuruma ihtimalı olmuş olabilir fazla ısıtıldığı için. Personellere ürün ısınma süreleri hakkında tekrar eğitim verilecektir.',3,8,'2025-06-17 17:42:20'),(23,19,12,1,'Merhabalar Ürünün raf ömrü 12.06.2025 ürün +2 derece ile sabah 10:00 da tezgaha açılmıştır üründe duyusal yapılmıştır herhangi bi problem  olmamıştır. gün içerisinde ürün sürekli olarak yenilenerek tezgaha konulmuştur. Et yemeği olarak o gün domates soslu etimiz vardı skt olarak raf ömrü 10.06.2025 dir herhangi bi misafirimizden  ürün hakkında kötü bi dönüş olmadı sözlü olarak. tezgahta ürün duyusalı yapılmıştır. ürünün sert olması ısınma süresi ile ilgili olabilme ihtimali olabilir, bazı misafirlerimiz ürünün fazla ısıtılmasını talep ediyor, ürün 260 derece ile ısındığı için üzerinde kuruma ihtimalı olmuş olabilir fazla ısıtıldığı için. Personellere ürün ısınma süreleri hakkında tekrar eğitim verilecektir.',NULL,NULL,'2025-06-17 17:45:00'),(24,19,2,2,'Verilen eğitimlerin sonraki DF\'lerde görselleri ekleyiniz.',8,9,'2025-06-17 20:37:34'),(25,19,12,3,'Aksiyonlar Emaar Şube tarafından tamamlandı.',9,11,'2025-06-17 20:49:19'),(26,19,3,2,'DÖF çözümü kaynak departman tarafından onaylanmıştır.',11,5,'2025-06-18 12:29:27'),(27,20,3,1,'DÖF oluşturuldu',NULL,NULL,'2025-06-18 13:54:01'),(28,19,2,2,'kapatıldı.',5,6,'2025-06-18 16:21:26'),(29,20,2,2,'DÖF Zorlu Şube departmanına atandı: Müşteri şikayet bildirimi net anlaşılır değil. Müşteri yaklaşımı ve memnuniyeti (personel yaklaşımı) olarak kök neden değerlendirmesi gerçekleştirelim.',2,3,'2025-06-18 19:02:33'),(30,20,20,2,'',3,8,'2025-06-18 19:45:21'),(31,21,3,1,'DÖF oluşturuldu',NULL,NULL,'2025-06-19 12:21:35'),(32,20,2,2,'Aksiyonunuzu kapatırken, eğitim kayıtlarının tutulmuş olması gerekmektedir.',8,9,'2025-06-19 15:06:20'),(33,21,2,1,'Online sipariş dönüşüdür. Servis gitmemiş ve dönüş sağlanmıştır. ',NULL,NULL,'2025-06-19 15:11:40'),(34,21,2,2,'DÖF Acarkent Şube departmanına atandı: Online sipariş dönüşüdür. Servis gitmemiş ve dönüş sağlanmıştır. Bu konu baz alınarak DF çalışması gerçekleştirilmelidir.',2,3,'2025-06-19 15:12:44'),(35,21,14,2,'',3,8,'2025-06-19 17:12:52'),(36,21,2,2,'Gerekli sürecin tamamlanması için ilgili yazışmanın görselini de (mail yazışması) ekleyerek DF kapama işlemi yapalım.',8,9,'2025-06-19 17:25:55'),(37,22,3,1,'DÖF oluşturuldu',NULL,NULL,'2025-06-20 12:37:11'),(38,23,3,1,'DÖF oluşturuldu',NULL,NULL,'2025-06-20 12:38:37'),(39,22,2,2,'DÖF Suadiye Şube departmanına atandı: El ile yazı mı gönderilmekte? Bu işleyiş için kreatiften onaylı yazı metni ve baskılar geldi. harici birşey mi kullanılmakta. Hem bunu hem de müşteri şikayetini ayrıca değerlendirelim.',2,3,'2025-06-20 14:03:00'),(40,20,20,3,'Aksiyonlar Zorlu Şube tarafından tamamlandı.',9,5,'2025-06-20 14:12:37'),(41,23,2,2,'DÖF Kalite Yönetimi departmanına atandı: .',2,3,'2025-06-20 14:20:06'),(42,23,2,3,'Departman değiştirildi: Kalite Yönetimi -> Beraber Kalite',NULL,NULL,'2025-06-20 11:44:30'),(43,20,2,2,'Eğitim kayıtlarını kontrollerde bakılabilecek şekilde kayıt altında tutunuz.',5,6,'2025-06-20 14:56:28'),(44,24,3,1,'DÖF oluşturuldu',NULL,NULL,'2025-06-20 16:25:32'),(45,24,2,2,'DÖF İstinye Şube departmanına atandı: İstinye Park özelinde \"misafir memnuniyeti\" dönüşler fazlasıyla mevcuttur. Konu hakkında bu tarz bir uygunsuzluğun tekrar yaşanmaması adına, tüm süreçlerinizde yapılacak incelemeye dair gerekli kök neden analizinin yapılmasını ; elde edilen sonuçların ve alınan aksiyonların tarafımıza iletilmesini gerekmektedir.\r\n',2,3,'2025-06-20 16:40:42'),(46,24,2,1,'Nuray Hanım, detay da ekledim konu hakkında.\r\n\r\nÜst üste bu tarz misafir memnuniyeti için çok fazla geri bildirim alındı. Bu sebepten detay bir çalışma beklenmektedir.',NULL,NULL,'2025-06-20 16:41:59'),(47,25,3,1,'DÖF oluşturuldu',NULL,NULL,'2025-06-23 08:58:40'),(48,25,2,2,'DÖF Zorlu Şube departmanına atandı: Şikayetin gün ve saatini bulmaya çalışarak ilerleyelim. ',2,3,'2025-06-23 09:08:08'),(50,28,3,1,'DÖF oluşturuldu',NULL,NULL,'2025-06-23 10:11:42'),(54,28,3,1,'çok güler yüzlü bir hizmet aldığımı söyleyebilirim, yemekler çok taze ve ürünler lezzetliydi.',NULL,NULL,'2025-06-23 10:45:48'),(55,28,3,1,'21.06.2025 Yorum Tarihi',NULL,NULL,'2025-06-23 10:46:14'),(58,32,3,1,'DÖF oluşturuldu',NULL,NULL,'2025-06-23 11:37:26'),(59,28,2,2,'DÖF Garaj Kalite departmanına atandı: İlgili misafir şikayetindeki görsel incelendiğinde İstinye park şubemizin uygunsuzluğu olarak belirlenmiştir. Ürün gramajları (hem protein hem de baz) belirlenen gramajlarda hazırlanmamıştır. Bununla birlikte protein de yemek bütünlüğü mevcut değildir, yemeğin sos kısmı görülmemektedir. Bu doğrultuda gerekli çalışma dönüşü sağlansın.',2,3,'2025-06-23 12:03:28'),(60,28,2,3,'Departman değiştirildi: Garaj Kalite -> İstinye Şube',NULL,NULL,'2025-06-23 12:03:46'),(61,32,2,2,'DÖF Garaj Kalite departmanına atandı: Gelen müşteri şikayetine istinaden duyusal değerlendirmeler için gerekli kontrolleri ve aksiyon çalışması yapılması gerekmektedir.',2,3,'2025-06-23 12:04:55'),(62,32,2,3,'Departman değiştirildi: Garaj Kalite -> İstinye Şube',NULL,NULL,'2025-06-23 12:05:15'),(63,25,20,2,'İlgili şikayet Barista kasası arızalı olduğu için personelin misafiri ana kasaya yönlendirmesi sonucu Ana kasadaki personelinde o an yoğunluktan dolayı barista kasasının arızalı olduğunu bilmemesi sebebiyle miasfiri bekletmemek için tekrar barista kasasına  yönlenlendirmesi ile hem ana kasa hem barista kasasındaki personellerin koordinasyon eksikliği ve misafir iletişimi eksikliği sebebiyle yaşanmıştır. ',3,8,'2025-06-23 18:21:14'),(64,25,2,2,'Çalışma ve değerlendirme için teşekkür ederim. İlgili aksiyon planı Bölge ve Operasyon yetkilileri ile de paylaşılacaktır.',8,9,'2025-06-24 08:43:43'),(65,33,3,1,'DÖF oluşturuldu',NULL,NULL,'2025-06-24 10:51:37'),(66,33,2,2,'DÖF Suadiye Şube departmanına atandı: Konu hakkında detaylı çalışma gerçekleştirilsin',2,3,'2025-06-24 11:23:47'),(68,35,3,1,'DÖF oluşturuldu',NULL,NULL,'2025-06-24 11:37:37'),(69,35,2,2,'Yeni DÖF açılması talep edildi: Zeynep Hanım, bu şikayeti üçe bölelim. Biri görsel kaynaklı kreatif, diğeri garaj kalite, diğeri de şube olacak şekilde. Ben buradan DF kapatıyorum.',2,6,'2025-06-24 11:46:44'),(70,36,3,1,'DÖF oluşturuldu',NULL,NULL,'2025-06-24 12:16:03'),(71,37,3,1,'DÖF oluşturuldu',NULL,NULL,'2025-06-24 12:18:25'),(72,38,3,1,'DÖF oluşturuldu',NULL,NULL,'2025-06-24 12:27:59'),(73,36,2,2,'DÖF Garaj Kalite departmanına atandı: Tuğçe Hanım, ilgili şikayet için ürünün sert olması yönünde değerlendirme gerçekleştirmeniz yeterli olacaktır. Ürün prosesi fırınlama şeklinde olduğunu ayrıca belirtelim.',2,3,'2025-06-24 12:28:19'),(74,37,2,2,'DÖF Suadiye Şube departmanına atandı: Merhabalar;\r\nGörsel farklılık haricinde yer alan geri bildirimler için çalışma ve dönüş sağlayalım.',2,3,'2025-06-24 12:29:23'),(75,38,2,2,'DÖF Kreatif departmanına atandı: Merhabalar;\r\nMenü değişkenliği ile ürün görsellerindeki revizelerin ve/veya bilgilendirmelerin eksik kalması için gerekli çalışma dönüşü gerekmektedir.',2,3,'2025-06-24 12:30:07'),(76,36,43,2,'',3,8,'2025-06-24 16:19:53'),(77,36,43,2,'Aksiyon planında belirtilen tüm faaliyetler Garaj Kalite departmanı tarafından başarıyla tamamlanmıştır.',8,10,'2025-06-24 16:20:03'),(78,36,1,2,'DÖF kaynak değerlendirmesi aşamasına manuel olarak taşındı',10,11,'2025-06-24 17:30:57'),(79,36,3,3,'DÖF çözümü kaynak departman tarafından onaylanmıştır.',11,5,'2025-06-24 17:31:32'),(80,25,20,1,'İlgili Eğitimler personellere verilmiştir. Bilgilerinize sunarım.',NULL,NULL,'2025-06-24 18:07:11'),(81,25,20,2,'Aksiyon planında belirtilen tüm faaliyetler Zorlu Şube departmanı tarafından başarıyla tamamlanmıştır.',9,11,'2025-06-24 18:07:51'),(82,23,44,1,'Şahit numuneler ve geriye dönük proses kayıtları kontrol edildiğinde herhangi bir uygunsuzlukla karşılaşılmamıştır. Ancak olası sebeplerden dolayı ilgili çalışanlara tartım ve hazırlık yineleme eğitimleri verilecektir. ',NULL,NULL,'2025-06-25 07:45:32'),(83,23,44,1,'Şahit numuneler ve geriye dönük proses kayıtları kontrol edilecektir.',NULL,NULL,'2025-06-25 07:46:14'),(84,23,44,2,'',3,8,'2025-06-25 07:48:33'),(85,23,44,2,'Aksiyon planında belirtilen tüm faaliyetler Beraber Kalite departmanı tarafından başarıyla tamamlanmıştır.',8,11,'2025-06-25 07:48:50'),(86,25,3,3,'DÖF çözümü kaynak departman tarafından onaylanmıştır.',11,5,'2025-06-25 08:32:55'),(87,23,3,3,'DÖF çözümü kaynak departman tarafından onaylanmıştır.',11,5,'2025-06-25 08:36:56'),(88,39,3,1,'DÖF oluşturuldu',NULL,NULL,'2025-06-25 09:31:05'),(89,36,2,2,'.',5,6,'2025-06-25 09:32:29'),(90,39,2,2,'DÖF Orjin Şube departmanına atandı: Konu ile ilgili olarak işleyişimiz doğrultusunda olmasından dolayı alınabilecek bir aksiyon mevcut değildir. Orjin şubemiz ilgili geri bildirim için sadece personel özelinde misafir karşılama ve sunum başlıkları altında yenileme eğitimleri ve gözlem sonrası aksiyon kapama şeklinde ilerleyebilir.',2,3,'2025-06-25 09:36:18'),(91,25,2,2,'.',5,6,'2025-06-25 09:46:36'),(92,23,2,2,'.',5,6,'2025-06-25 09:53:59'),(93,40,3,1,'DÖF oluşturuldu',NULL,NULL,'2025-06-25 10:55:55'),(94,40,2,2,'DÖF Suadiye Şube departmanına atandı: İvedi dönüş beklenmektedir. Ayrıca misafir bu haftaki olan yabancı madde çıkışını nereden biliyor. Bununla birlikte paket için tezgah arkasına sivil geçilmemesi için çalışma yapalım.',2,3,'2025-06-25 13:05:00'),(95,21,14,1,'Gerekli olan çatal bıçak kaşık paket servis grubu depo kısımından temini gerçekleşmiştir. Paket servislerimize eklenmeye başlamıştır. ',NULL,NULL,'2025-06-25 14:44:09'),(96,21,14,2,'Aksiyon planında belirtilen tüm faaliyetler Acarkent Şube departmanı tarafından başarıyla tamamlanmıştır.',9,11,'2025-06-25 14:44:28'),(97,39,29,1,'Merhabalar,\r\nYemek sunumunda kullanılan ekipmanların güvenliği ve müşterilerimizin sağlığı bizim önceliğimizdir. Belirtildiği gibi tabağın aşırı sıcak olması ve bunun sonucunda misafirimizin elinin yanması konusundaki tüm detayları incelemeye aldık. bu konuda alınan önlemler ; \r\n- Yoğunluk anında (12:00: 13:30) arası fırında ısınan yemeklerin porsiyonunu arttırıp daha az sıcak tabak ile misafirlerimizi buluşturmak.\r\n- Personellere tekrardan her müşteriye tabağın sıcak olduğunu özellikle belirtmek.\r\n\r\nSunum sürecimizde ve personel bilgilendirilmelerinde gerekli iyileştirmeleri yapacağımızı temin ederiz.\r\n\r\n ',NULL,NULL,'2025-06-25 14:49:51'),(98,39,29,2,'Her misafire muhakkak tabağın sıcak olduğu belirtiliyor fakat tekrardan yönlendirme ve bilgilendirme sağlanacak.',3,8,'2025-06-25 15:00:05'),(99,32,22,1,'Misafirimizin bahsettiği gün pazar günü olarak anladım. Tezgahta 23.06.2024 sktli Kremalı Mantarlı Piliç ürünümüz var. Ürün miktarı az olduğu için saat 15.00 civarı yeni ürün olan Kremalı Mantarlı Tavuk ürünü açılmış. Coslow ürünü tezgahın diğer ucunda bulunuyor. Mantar salatası tarzı bir ürün tezhahta bulunmuyor, bulaş riski açısından. Aynı zamanda tezgahta açık olan patates 1 gün önce gelen Kuru Domatesli Baby Patates. Ekip arkadaşlarımız ile görüştüm, ürünler ile ilgili sabah hepsini taze açtıklarını ve yoğunluktan dolayı, sürekli tazelendiğini, misafirlerden dönüş almadıklarını ilettiler. Mümkün ise dönüşü yapan kişinin paylaşılmasını rica ediyoruz, tahminimizce Ukrayna’lı olduğunu düşündüğümüz bir misafirimiz var. Fiyatlardan dolayı kasada daima söyleniyor, ve her geldiğinde muhakkak kusur buluyor ve ikram istiyor. ',NULL,NULL,'2025-06-25 15:15:25'),(100,28,22,1,'Merhabalar, şubemize kadro eksikliğinden dolayı dış kaynaklı personel gelmektedir. Bu hatanın destek gelen personel kaynaklı olduğunu düşünüyoruz. Yeniden detaylı gramaj ve ölçü anlatımlarını yaptık. Böyle bir durumun yeniden yaşanmaması için destek personellerin hazırladığı tabakları, kadrolu personeller onaylayıp, o şekilde misafirimize sunuyoruz. ',NULL,NULL,'2025-06-25 15:33:08'),(101,32,22,2,'',3,8,'2025-06-25 15:48:04'),(102,32,22,2,'Aksiyon planında belirtilen tüm faaliyetler İstinye Şube departmanı tarafından başarıyla tamamlanmıştır.',8,11,'2025-06-25 15:48:28'),(103,39,2,2,'.',8,9,'2025-06-25 15:51:10'),(104,28,22,2,'',3,8,'2025-06-25 15:58:17'),(105,28,22,2,'Aksiyon planında belirtilen tüm faaliyetler İstinye Şube departmanı tarafından başarıyla tamamlanmıştır.',8,11,'2025-06-25 15:58:25'),(106,32,3,3,'DÖF çözümü kaynak departman tarafından onaylanmıştır.',11,5,'2025-06-25 16:41:16'),(107,24,22,1,'Merhabalar, bu olay geçtiğimiz günlerde benim kasada bulunduğum anda yaşanmıştır, hanımefendi Avm personeli olduğunu iletmiş; ancak ne üzerinde personel olduğuna dair bir emare vardır, ne de  personel kartı gösterebilmiştir. Tezgahta ilk etapta personel menüsü sorduğunu, onların bana söylemesi gerektiğini iletmiştir. Bu durum öğle servisi sonuna doğru, yoğun olduğumuz bir anda yaşanmıştır. Kendisine misafirlarimizin kasaya geldiğinde söylemesi gerektiğini, personel kimliği olmadan yapamadığımızı, telafi amaçlı çay ya da taze filtre kahvemiz var onlardan ikram edebiliriz, ama sonrası için tezgahtaki arkadaşımızın kasadaki süreci takip etmesinin zor olduğunu ilettim. ',NULL,NULL,'2025-06-25 16:45:54'),(108,39,29,2,'Aksiyon planında belirtilen tüm faaliyetler Orjin Şube departmanı tarafından başarıyla ta