niz.\r\n* Bunun için bir eğitim kaydı var mı? Varsa onu plana da ekleyip, görselini kapamaya koymalısınız.\r\n* Uygun bir aksiyon planı değil.',8,4,'2025-07-02 11:27:05'),(152,42,2,2,'* İlgili oryantasyon için \"Eğitim Kaydını\" DF kapanışına ekleyelim.\r\n\r\n* Ancak tespit edilen paket için herhangi bir aksiyon mevcut değildir. Bu durum için neler yapıldı onun da harici olarak çalışmasını yapalım. kapanışta onu da iletebilirsiniz.',8,9,'2025-07-02 11:28:39'),(153,45,2,2,'Planlı bir DF analizi mevcut değil.',8,4,'2025-07-02 11:29:13'),(154,46,2,2,'* Son 3/4 şikayet için entegrasyon problemi belirtilmekte ancak bunun için hiçbir aksiyon planı mevcut değl. Ömer Bey\'e iletildiği bilgisi var ancak takip ve konyrol kimde oacak. Hangi termin belirlendi mevcut değil. DF aksiyon planı yetersiz.',8,4,'2025-07-02 11:30:47'),(155,24,3,1,'Tadini halen begeniyorum cok guzel ve doyurucu. Fakat yillardir sevecen ve surekli gulumseyen calisanlar gitti yerlerine olabilecek en bet suratli, somurtkan ve iletisim ozurlu insanlar geldi, bunun sebebi nedir? (1.07.2025- Google Geri Bildirimi)',NULL,NULL,'2025-07-04 08:59:28'),(157,53,3,1,'DÖF oluşturuldu',NULL,NULL,'2025-07-04 10:19:18'),(158,53,2,2,'DÖF Zorlu Şube departmanına atandı: .',2,3,'2025-07-04 11:17:30'),(159,44,13,1,'Öğlen yoğunluğumuzda ortalama 150-200 çek yaptığımızdan kaynaklı 2 adet demlik yetersiz kalabiliyor. sürekli taze çay demleniyor bazen yoğunluktan ötürü çay demini almadığından misafir beklemek istememesinden kaynaklı bu gibi duruma sebebiyet olmuştur. Önlem amaçlı bu durumun yaşanmaması adına termosa ekstra çay demliyoruz. ',NULL,NULL,'2025-07-04 11:40:45'),(160,44,13,2,'',3,8,'2025-07-04 11:45:20'),(161,38,51,2,'',3,8,'2025-07-04 11:46:17'),(162,38,51,2,'Aksiyon planında belirtilen tüm faaliyetler Kreatif departmanı tarafından başarıyla tamamlanmıştır.',8,11,'2025-07-04 11:46:33'),(163,44,13,1,'öğlen servisinde 150-200 misafir ağırlıyoruz 2 adet demlik yetersiz kalabiliyor. demini almadan misafire çay verilmiş olabilir. çay bittiğinde hemen arkasından tekrardan çay demlenmemiş olabilir. bu gibi durumları önlemek için termosa çay demlenmesi bilgisi verilmiştir. takibi yapılarak bu gibi durumların önüne geçmek için daha dikkatli olunacaktır.',NULL,NULL,'2025-07-04 11:48:32'),(164,44,13,2,'Aksiyon planında belirtilen tüm faaliyetler Kanyon Şube departmanı tarafından başarıyla tamamlanmıştır.',8,11,'2025-07-04 11:49:21'),(165,44,13,1,'öğlen 150-200 misafir şubemize gelmektedir. 2 adet demlik yetersiz kalabiliyor. çay bittiğinde hemen demlenmemesinden kaynaklı çay demlendikten sonra demini almadan misafire beklememesi için verildiyse bundan kaynaklı misafirimiz çayımızı beğenmemiş olabilir. tüm personller konu hakkında uyarılmış olup termosa ekstra çay demlenerek önlem alınmıştır.',NULL,NULL,'2025-07-04 11:52:13'),(166,50,19,1,'Merhaba, misafirimize siparişi tam ve eksiksiz gönderildi ancak ulaşım kaynaklı bir sorun olduğunu tahmin ediyoruz.',NULL,NULL,'2025-07-04 11:59:22'),(167,50,19,1,'Merhaba, misafirimize siparişi tam ve eksiksiz gönderildi ancak ulaşım kaynaklı bir sorun olduğunu tahmin ediyoruz.\r\n',NULL,NULL,'2025-07-04 12:00:32'),(168,38,3,3,'DÖF çözümü kaynak departman tarafından onaylanmıştır.',11,5,'2025-07-04 12:54:00'),(169,44,3,3,'DÖF çözümü kaynak departman tarafından onaylanmıştır.',11,5,'2025-07-04 12:54:45'),(170,38,2,2,'.',5,6,'2025-07-04 13:03:06'),(171,44,2,2,'.',5,6,'2025-07-04 13:03:30'),(172,24,22,2,'',3,8,'2025-07-04 15:46:24'),(173,54,22,1,'DÖF oluşturuldu',NULL,NULL,'2025-07-04 16:17:54'),(174,54,2,2,'DÖF Garaj Satın Alma departmanına atandı: Merhabalar;\r\nSürecin neden uzadığına dair, talebin karşılanmaması ve/veya dönüş sağlanmaması konuları için \"neden\" çalışması gerçekleştirelim.',2,3,'2025-07-05 08:03:30'),(175,24,2,2,'Aksiyon planında da tanımlama gerçekleştirelim.',8,4,'2025-07-05 08:07:04'),(176,41,20,2,'Aksiyon planında belirtilen tüm faaliyetler Zorlu Şube departmanı tarafından başarıyla tamamlanmıştır.',9,11,'2025-07-05 18:13:48'),(177,55,12,1,'DÖF oluşturuldu',NULL,NULL,'2025-07-06 14:31:39'),(178,55,12,1,'Misafirler ürünler hakkında bilgiye sahip olmak istiyorlar',NULL,NULL,'2025-07-06 14:32:42'),(179,55,12,1,'Herhangi bir dış denetimde marka maddi olarak zarar görmemesi.',NULL,NULL,'2025-07-06 14:34:04'),(180,56,12,1,'DÖF oluşturuldu',NULL,NULL,'2025-07-06 14:42:21'),(182,58,27,1,'DÖF oluşturuldu',NULL,NULL,'2025-07-06 23:23:21'),(183,58,27,1,'-',NULL,NULL,'2025-07-06 23:24:19'),(184,54,45,1,'Merhabalar,\r\n\r\nİstinye Park şubesi tarafından;\r\n\r\n12.03.2025 tarihinde iletilen hassas terazi talebi ile ilgili olarak; talep sonrası terazi gönderimi sağlanmış, ancak ürün büyük boy model olup tarafımıza yazılı bir boyut belirtimi yapılmamıştır. Bu nedenle stoklarımızda bulunan küçük modelin gönderimi sağlanmıştır. Bu işlem sonrası olumlu veya olumsuz herhangi bir geri dönüş alınmamıştır.\r\n\r\n22.05.2025 tarihinde talep edilen 3 adet 1000 cc ve 4 adet 500 cc fişek sosluk taleplerine istinaden ise, depo stoklarımızda bulunan 500 cc ürünlerden gönderim yapılmıştır.\r\n\r\nAncak, hassas terazi ile ilgili aciliyet belirtilen bir konuda 4 ay sonra DÖF (Düzeltici Önleyici Faaliyet) açılması, yoğun bir operasyon sürecine sahip olan satınalma birimi açısından süreç yönetimi açısından sorgulanması gereken bir durumdur.\r\n\r\nYapılan incelemeler sonucunda, personel eksikliği ve yeni mağaza açılışları gibi nedenlerle, gelen taleplere yazılı dönüşlerin yapılamaması kaynaklı iletişim kopuklukları yaşandığı tespit edilmiştir.\r\n\r\nBu ve benzeri süreçlerin daha sağlıklı ilerleyebilmesi adına, proje özelinde demirbaş talep formu ile  ve her ayın 15’inde toplanması yönünde yapılan bilgilendirmelere uygun hareket edilmesinin önemini tekrar hatırlatmak isteriz.\r\n\r\nSaygılarımızla,',NULL,NULL,'2025-07-07 09:44:02'),(185,56,49,1,'Emaar şubeye son 2 ay içinde FTH soğutma çok sık ziyarette bulunmuştur, 2 gün önce fth soğutma yine oradaydı buz makinesinin tamiri için .\r\n1 hafta önce depodaki soğuk oda tamiri içinde oradaydı ilgili servis geldiğinde atlanmış sanırım gösterilmemiş yoksa müdahale edilirdi. \r\nyarın tekrar şubede olacak genel tüm dolapların kontrolünü istedim',NULL,NULL,'2025-07-07 10:25:59'),(186,55,2,2,'Yeni DÖF açılması talep edildi: Merhabalar;\r\nBu süreçte aksaklıklar olması sonucunda konu DF takibine düşer. Örneğin; kreatife birden çok talep olmuştur, bunların talepleri yapılmasına rağmen hiçbir şekilde sizlere geri dönüş gerçekleştirilmemiştir. BU durum doğrultusunda birimden düzeltici istenebilir. Ancak talep kısmı DF süreci içerisinde değildir. Eğer DF olarak bunu işleme almak grekirse tüm taleplerin iletildiği tarih ve karşılık bulamayan kısımlarının iletilmesi gerekmektedir. Yani DF açık ve anlaşılır şekilde ifade edilmelidir.',2,6,'2025-07-07 11:02:13'),(187,56,2,2,'Yeni DÖF açılması talep edildi: Merhabalar;\r\nBu süreçte aksaklıklar olması sonucunda konu DF takibine düşer. Talep kısmı DF süreci içerisinde değildir. Eğer DF olarak bunu işleme almak gerekirse tüm taleplerin iletildiği tarih ve karşılık bulamayan kısımlarının iletilmesi gerekmektedir. Yani DF açık ve anlaşılır şekilde ifade edilmelidir. \r\n* Burada eğer almış olduğumuz hizmetin yetersiz olduğunu düşünüyorsanız teknik birimden destek istenebilir. Aksaklık durumunda düzeltme talabine geçiş yapılır.',2,6,'2025-07-07 11:05:57'),(188,59,30,1,'DÖF oluşturuldu',NULL,NULL,'2025-07-07 12:37:09'),(189,51,43,2,'',3,8,'2025-07-07 15:35:16'),(190,51,43,1,'',NULL,NULL,'2025-07-07 15:35:22'),(191,51,43,1,'',NULL,NULL,'2025-07-07 15:35:38'),(192,24,22,1,'',NULL,NULL,'2025-07-07 15:39:59'),(193,24,22,1,'',NULL,NULL,'2025-07-07 15:40:05'),(194,24,22,1,'',NULL,NULL,'2025-07-07 15:41:39'),(195,24,22,1,'',NULL,NULL,'2025-07-07 15:41:50'),(196,60,13,1,'DÖF oluşturuldu',NULL,NULL,'2025-07-07 19:13:26'),(197,61,13,1,'DÖF oluşturuldu',NULL,NULL,'2025-07-07 19:14:33'),(198,62,23,1,'DÖF oluşturuldu',NULL,NULL,'2025-07-08 10:46:57'),(199,59,2,2,'Yeni DÖF açılması talep edildi: Merhabalar;\r\nGeriye dönük daha fazla veri ile daha detaylı bir tanımlama gerçekleştirelim. Örneğin; son bir ayda Sütaştan gelen ürün çeşitleri ve ret verilen tüm ürün grupları vs. İlk olarak bu şekilde başlayalım.\r\n\r\nİyi çalışmalar.',2,6,'2025-07-08 10:53:47'),(200,60,2,2,'Yeni DÖF açılması talep edildi: Merhabalar;\r\n\r\nTalep ile uygunsuzluk takibini birbirine karıştırmayalım. Örneğin; lava talep etmişinizdir ancak onay alındığı halde süreç uzamıştır gibi bir durumda DF takibi istenir. Veya konu hakkında gelen lavalar uygun standartlarda değildi o zaman DF takibi yapılır.\r\n\r\nKonu hakkında öneri olarak bir DF kaydı açılabilir bu da \"Operasyon Yöneticinize\" yapılmalıdır. Öneri değerlendirildikten sonra satın alma süreci takip edilir.\r\n\r\nİyi çalışmalar dilerim.',2,6,'2025-07-08 10:56:08'),(201,63,23,1,'DÖF oluşturuldu',NULL,NULL,'2025-07-08 10:57:03'),(202,61,2,2,'Yeni DÖF açılması talep edildi: Merhabalar;\r\n\r\nTalepler için mail ile iletişim kurulması gerekmektedir. Talebin farklı veya uygun olmayan standarta gelmesi DF takibine girer.\r\n\r\nİyi çalışmalar dilerim.',2,6,'2025-07-08 10:57:05'),(203,62,2,2,'Gereksiz DÖF olarak değerlendirildi ve kapatıldı: Merhabalar;\r\n\r\nTalepler için mail ile iletişim kurulması gerekmektedir. Talebin farklı veya uygun olmayan standarta gelmesi DF takibine girer.\r\n\r\nTalep ile uygunsuzluk takibi başka bir veridir.\r\n\r\nBununla birlikte firma değişimi de gerçekleştirilmeyecektir.\r\n\r\nKonu altyapısal bir takip gerekmektedir.\r\n\r\nİyi çalışmalar dilerim.',2,6,'2025-07-08 10:58:43'),(204,63,2,2,'Yeni DÖF açılması talep edildi: Merhabalar;\r\n\r\nTalepler için mail ile iletişim kurulması gerekmektedir. Talebin farklı veya uygun olmayan standarta gelmesi DF takibine girer.\r\n\r\nTalep ile uygunsuzluk takibi başka bir veridir.\r\n\r\nİyi çalışmalar dilerim.',2,6,'2025-07-08 10:59:17'),(205,51,2,2,'.',8,9,'2025-07-08 10:59:55'),(206,24,22,1,'',NULL,NULL,'2025-07-08 16:11:54'),(207,24,22,1,'',NULL,NULL,'2025-07-08 16:12:02'),(208,24,