ası talep edildi: Takibini yaptıktan sonra süreçleri aktararak DF yenileme yapalım.',2,6,'2025-07-16 13:38:05'),(276,85,2,2,'Gereksiz DÖF olarak değerlendirildi ve kapatıldı: İlgili tatlı için alternatif mevcut değilmiş bu sebepten gönderim sağlanmış. \r\n\r\nSatın alma birimi ile görüşülerek delist olduğu hatırlattıldı. Tatlı için alternatif bakılacağı iiletildi.',2,6,'2025-07-16 13:39:35'),(277,83,17,1,'Tezgah ve Bowl da bulunan tüm ürünlere tekrar tadım yapıldı. Ürünlerde herhangi bir tadım bozukluğunun olmadığı gözlemlendi. Personllerimize gerekli bilgilendirme yapılmıştır.',NULL,NULL,'2025-07-16 15:18:31'),(278,82,17,1,'Yoğunluktan dolayı personelimiz paketlerde kullanılan setupları eksik göndermiştir. Gerekli uyarılar personelimize yapılmış olup aksiyonlarımız alınmıştır.',NULL,NULL,'2025-07-16 15:20:40'),(279,79,17,1,'Oluşan hatadan dolayı misafir aranmış olup kendisi restorantımıza davet edilmiştir. Personellerimize bu konulara dikkat etmesi gerektiği ve aksiyonlar hakkında bilgi verilmiştir.',NULL,NULL,'2025-07-16 15:22:45'),(280,80,17,1,'Misafirimize ürün hatası ve olumsuz deneyimi hakkında gerekli bilgilendirme ve ikramlar yapılmıştır. Bahsedilen ürünler tadım ve görüntü kontrolü yapılmış olup gerekli değişim ve aksiyonlar alınmıştır. Personele gerekli bilgilendirme yapılmıştır.',NULL,NULL,'2025-07-16 15:25:56'),(281,75,17,1,'Salon ve mutfak ekibimize gerekli bilgilendirmeler yapıldı. Servis konusunda gerekli iyileştirmeler ve aksiyonlar alındı. Servis kalitesini ve müşteri memnuniyetini arttırıcı hamleler yapıldı.',NULL,NULL,'2025-07-16 15:37:33'),(282,49,17,1,'Misafirimizle gerekli iletişim sağlanmış olup müşteri memnuniyeti sağlandı. Kendisi ayrıca restorantımıza davet edildi. Personelimize gerekli uyarılar yapıldı. Aksiyon planı ve uyulması gereken kurallar aktarıldı.',NULL,NULL,'2025-07-16 15:41:06'),(283,48,17,1,'Paket servislerde kullanılan ürün kontrolleri tekrar sağlandı. Hijyen ve ürün kalitesini arttırmak için gerekli planlama yapıldı ve personellerimize gerekli uyarılar yapıldı. Paket ürün hazırlama aksiyonu tekrar personelimize gösterildi ve bilgisi verildi.',NULL,NULL,'2025-07-16 15:44:42'),(284,79,2,3,'Departman değiştirildi: Suadiye Şube -> Zorlu Şube',NULL,NULL,'2025-07-17 09:36:44'),(285,82,17,1,'Merhabalar, paket serviste kullandığımız çatal bıçak takımı , dolabın içerisinden personelin görebileceği açık bir bölüme alınarak personellerimiz konu hakkında bilgilendirilmiştir.',NULL,NULL,'2025-07-17 13:24:55'),(286,83,17,1,'Merhabalar, Misafirimizin geri bildirimi haklı olup, Bowl tezgahımızda soğutma ile alakalı sorunlar yaşamakta olup, gerekli servis talebi oluşturulmuştur. Bu süreçte servis gelene kadar tezgahta aldığımız aksiyonlar dosya ekinde sizler ile paylaşılmıştır.\r\niyi çalışmalar dilerim.\r\nMesut YILDIZ.',NULL,NULL,'2025-07-17 15:13:14'),(287,74,22,2,'',3,8,'2025-07-17 15:23:28'),(288,75,17,1,'Misafirimiz bu konu da haklı olup. Konu ile ilgili misafirimiz restoranda  iken memnuniyet sağlanmıştır. Gecikmenin asıl sebebi olan poşe yumurtanın kıvamının yakalanamamasından dolayı timeing süresi uzadığı için bu yorumu almış bulunmaktayız. misafirimizden iyi yönlerimizin yanında düzeltmemiz gereken yönlerimizi de feet back için bizzat yorum alınmıştır. Gün içinde personelimiz ile gerekli toplantılar yapılmış olup, aksiyon planlamamız içinde oryantasyon süreci dervreye biekez daha sokulmuştur.',NULL,NULL,'2025-07-17 16:41:07'),(289,46,17,1,'Personellerimiz ile toplantı yapılıp paket sürecinde yer alan tüm operasyon süreci eğitim eşliğinde paylaşılmıştır.\r\nürünlerin eksik gitmesi.\r\nürünlerin yanlış gitmesi\r\nürünlerin soğuk gitmesi\r\nürünlerin geç gitmesi \r\nbunlara bağlı tüm süreç ile alakalı eğitim verilmişti.\r\ndosyada sizlere sunulmuştur.\r\niyi çalışmalar dilerim.\r\n\r\nMesut YILDIZ.\r\n',NULL,NULL,'2025-07-17 17:19:47'),(290,40,17,1,'Tespit edilen saç kılının personelimize ait olduğu saptanmış olup, tezgah ve mutfak içerisinde kalite ve çalışma talimatlarına uygun bir şekilde personelimiz ile oryantasyon sürecini başlatıp, bu tarz şikayetleri en aza indirdik.\r\nBu konuda bizi en çok etkileyen durumun ise personel eksikliğinin yerini extra personeller ile atlatmamız. yeni hedeflerimiz doğrultusunda misafir memnuniyetimizi yine istenilen seviyelere getireceğimizi beyan eder iyi çalışmalar dilerim.\r\n\r\nMesut YILDIZ.\r\n',NULL,NULL,'2025-07-17 17:48:17'),(291,46,2,1,'Merhabalar;\r\n\r\nTamamlama işleminizi yorum olarak değil. \"Kök neden ve aksiyon planı gir\" ekranından revize olarak iletebilirseniz, DF kapatma işlemini gerçekleştirebiliriz\r\n',NULL,NULL,'2025-07-17 17:50:09'),(292,74,2,2,'.',8,9,'2025-07-17 17:52:43'),(293,86,3,1,'DÖF oluşturuldu',NULL,NULL,'2025-07-18 09:23:37'),(294,87,30,1,'DÖF oluşturuldu',NULL,NULL,'2025-07-18 12:28:40'),(295,88,30,1,'DÖF oluşturuldu',NULL,NULL,'2025-07-18 12:34:02'),(296,86,2,2,'DÖF Suadiye Şube departmanına atandı: .',2,3,'2025-07-18 12:46:28'),(297,87,2,2,'Gereksiz DÖF olarak değerlendirildi ve kapatıldı: Merhabalar;\r\n\r\nHemen DF açmayalım. Bu şekilde takip edilemez öncesinde bildirim yapalaım. Normal işleyişte bir aksaklık olması durumunda DF açılır ve takip istenir.\r\n\r\n',2,6,'2025-07-18 12:50:22'),(298,88,2,2,'Gereksiz DÖF olarak değerlendirildi ve kapatıldı: Merhabalar;\r\n\r\nHemen DF açmayalım. Bu şekilde takip edilemez öncesinde yaptığınız bildirimin dönüşünün beklenmesi ve sonuçlanması gerekiyor. Normal işleyişte bir aksaklık olması durumunda DF açılır ve takip istenir.\r\n\r\n',2,6,'2025-07-18 12:52:02'),(299,77,20,2,'',3,8,'2025-07-18 14:44:20'),(300,69,49,1,'Binaya gelen elektirik tesisatı koblolarının tümü yenişendi sorun çözüldü (17.07.2025)',NULL,NULL,'2025-07-18 14:48:06'),(301,69,49,1,'1 kez teşvikiye elektirik destek olmuş ancak sorun bulunamamıştır. Mevcut sorun için dolap motoru ses yapıyor dendi bu arızalı olup sartel attırıyor olabilir diye  dolap ustasınıda projeye gönderdik oda baktı 2. aksiyon olarak. 3. aksiyon olarak Elektrik mühendisi gönderdik oda binada 1,5 ay önce komple elektrik saatlerinin yenilenmiş ve yeni hat kablo çekim işlemi yapılmış olduğunu aktardı.\r\nBizim saatimiz ve hattımız yenilenmediği için bize ve anadolu hisarı ekibimizede kimse bilgi verilmediğinden süreç çözümü keşfinin zor yapılmış olmasından dolayı uzamıştır.',NULL,NULL,'2025-07-18 15:02:45'),(302,69,2,1,'Emre Bey,\r\nİlgili açıklamanıznı \"yorum\" kısmında değil \"kök neden ve aksiyon planı\" sekmesinden gerçekleştirirseniz. DF sürecini takip edip, kapatma işlemini yapabiliriz.',NULL,NULL,'2025-07-18 15:21:51'),(303,77,2,2,'.',8,9,'2025-07-18 15:22:39'),(304,69,49,2,'',3,8,'2025-07-18 15:40:46'),(305,69,2,2,'.',8,9,'2025-07-18 17:07:16'),(306,89,30,1,'DÖF oluşturuldu',NULL,NULL,'2025-07-18 17:07:44'),(308,89,2,2,'DÖF Garaj Satın Alma departmanına atandı: .\r\n',2,3,'2025-07-18 17:08:42'),(310,72,20,2,'',3,8,'2025-07-20 15:54:54'),(311,72,20,2,'Aksiyon planında belirtilen tüm faaliyetler Zorlu Şube departmanı tarafından başarıyla tamamlanmıştır.',8,11,'2025-07-20 15:55:20'),(312,79,20,2,'',3,8,'2025-07-20 16:06:15'),(313,79,20,1,'konu ile ilgili çalışanlara eğitim verilmiştr.',NULL,NULL,'2025-07-20 16:53:41'),(314,53,20,1,'konu ile ilgili eğitim verişlmiştir.',NULL,NULL,'2025-07-20 16:55:25'),(315,53,20,2,'Aksiyon planında belirtilen tüm faaliyetler Zorlu Şube departmanı tarafından başarıyla tamamlanmıştır.',9,11,'2025-07-20 16:55:41'),(316,79,2,2,'.',8,9,'2025-07-21 08:50:11'),(317,72,3,3,'DÖF çözümü kaynak departman tarafından onaylanmıştır.',11,5,'2025-07-21 08:57:46'),(318,53,3,3,'DÖF çözümü kaynak departman tarafından onaylanmıştır.',11,5,'2025-07-21 09:04:51'),(319,53,2,2,'.',5,6,'2025-07-21 13:58:16'),(320,72,2,2,'.',5,6,'2025-07-21 13:58:42'),(321,91,2,1,'DÖF oluşturuldu',NULL,NULL,'2025-07-22 09:36:30'),(322,91,2,2,'DÖF Vodafone Proje departmanına atandı: .',2,3,'2025-07-22 09:36:38'),(323,92,30,1,'DÖF oluşturuldu',NULL,NULL,'2025-07-22 09:41:34'),(324,93,30,1,'DÖF oluşturuldu',NULL,NULL,'2025-07-22 09:43:41'),(325,94,30,1,'DÖF oluşturuldu',