INSERT INTO `dofs` VALUES (19,'MU-EM-DU-MU-001','Emaar Misafir Geri Bildirimi ','Et açıkta beklediği için kurumuş ve sertleşmişti. Hardallı patatesin sosu diğer şubelerde yediğimden çok farklı, mayonezli patates salatası gibiydi. Ödediğim paranın karşılığını aldığımı düşünmüyorum',1,3,6,4,3,NULL,'2025-06-17 13:28:11','2025-06-18 16:21:26',NULL,'2025-06-18 16:21:26','üründe fazla ısınma olma ihtimali','tezgah arka kısımda tezgah açıklığı sebebi ile ürünün açıkta kalması','Et in  skt si nin aynı gün olması 10.06 skt tarihi','','','2025-06-17 03:00:00','Personellere Ürün ısınma ve raf ömürleri hakkında yeniden eğitim verilmesi. Üründe  duyusalın sürekli olarak yapılması konusunda aksiyon alınmıştır.',NULL,'website','2025-06-10 03:00:00'),(20,'MU-ZO-DU-MU-001','Zorlu Misafir Geri Bildirimi ','Devamlı geldiğim yerdi artık gelmeyeceğim. Berbatlar, çalışanları değişti sanırım berbat bir hizmet',1,3,6,11,3,NULL,'2025-06-18 13:54:01','2025-06-20 14:56:28',NULL,'2025-06-20 14:56:28','Yeni başlayan personellerin eğitim süreçlerini mağaza işleyişi sırasında deneyimlemesi','Mağaza ergonomik yapısı kaynaklı yoğunluk anlarında oluşan kaos','Mola ve vardiya geçişlerinde farklı pozisyonlardaki personellerin yer değiştirmesi','','','2025-06-18 03:00:00','Personellere misafir iletişimi ile ilgili eğitim verilecektir. Yeni başlayan personeller ilk hafta daha geri planda tutulup daha sıkı eğitim verildikten sonra kademeli olarak işleyişe dahil edilecektir. İş geçişlerinde farklı pozisyonda görev alan personeller içinde eğitim sonrası daha sıkı gözlem yapılarak belli bir seviyeye girmeden yoğunluk anlarında görev yeri değiştirilmeyecektir.',NULL,'google','2025-06-17 03:00:00'),(21,'MU-AC-DU-MU-001','Acarkent Bowl Misafir Geri Bildirimi ','Servis yoktu',1,3,6,6,3,NULL,'2025-06-19 12:21:35','2025-06-26 14:36:06',NULL,'2025-06-26 14:36:06','Şube tarafımızda paket servislerimiz bitmiş durumdadır. Depo tarafımızdan sipariş etmemize rağmen stok olmadığından şubeye gönderim yapılmamıştır. Bu nedenle misafirlerimize paket siparişinde servis gönderememekteyiz.','Şube tarafımızda paket servislerimiz bitmiş durumdadır. Depo tarafımızdan sipariş etmemize rağmen stok olmadığından şubeye gönderim yapılmamıştır. Bu nedenle misafirlerimize paket siparişinde servis gönderememekteyiz.','Şube tarafımızda paket servislerimiz bitmiş durumdadır. Depo tarafımızdan sipariş etmemize rağmen stok olmadığından şubeye gönderim yapılmamıştır. Bu nedenle misafirlerimize paket siparişinde servis gönderememekteyiz.','','','2025-06-30 03:00:00','Operasyon ile görüşüldü. Depo tarafından eksik servis ekipmanlarının temini beklenmektedir.\r\n',NULL,'yemeksepeti','2025-06-18 03:00:00'),(22,'MU-SU-DU-MU-001','Yemeksepeti Suadiye Bowl & Wrap Misafir Geri Bildirimi ','Kapağın üstüne bu güzel yemekte ne eksik? 5 yıldız vermeniz demişsiniz. Bunu yazana kadar keşke pilavımı koysaymışsınız. Eksik olan şey pilavım oldu. ',1,3,4,8,3,NULL,'2025-06-20 12:37:11','2025-07-02 11:21:20',NULL,NULL,'siparişte pilavın unutulması (ürün eksikiliği)','Siparişin değerlendirilmesini istemek ','dikkatsizlik','','','2025-07-01 00:00:00','misafirimizle iletişim sağlanmıştır.',NULL,'yemeksepeti','2025-06-19 03:00:00'),(23,'MU-KA-DU-MU-001','Yemeksepeti Hisar Misafir Geri Bildirimi ','Sarma çok tuzlu',1,3,6,31,3,NULL,'2025-06-20 12:38:37','2025-06-25 09:53:59',NULL,'2025-06-25 09:53:59','Asma yaprağı salamurasının normalden fazla gelmesi','Yaprak yıkama işleminin eksik yapılması','Sarma iç malzeme tuz tartımının eksik yapılması','','','2025-06-25 00:00:00','Şahit numuneler ve geriye dönük proses kayıtları kontrol edildiğinde herhangi bir uygunsuzlukla karşılaşılmamıştır. Ancak olası sebeplerden dolayı ilgili çalışanlara tartım ve hazırlık yineleme eğitimleri verilecektir. ',NULL,'yemeksepeti','2025-06-20 03:00:00'),(24,'MU-IS-DU-MU-001','İstinye Misafir Geri Bildirimi ','Sayın Yetkili,\r\n\r\nBugün İstinye Park’ta bulunan Plus Kitchen şubenize yemek yemek için geldim. Siparişimi verirken yemekleri koyan görevliye defalarca “indirimli menü oluşturalım” şeklinde açıkça talepte bulundum. Hatta aynı isteği görevlinin hemen yanındaki diğer çalışanlara da ilettim.\r\n\r\nAncak kasaya geldiğimde hiçbir indirim uygulanmadı. Durumu hatırlatınca, ödeme alındıktan sonra bana “ama siz söylemediniz ki” denildi. Bu ifade hem yaşananları çarpıtmakta hem de müşteriyi suçlar niteliktedir. Oysa çalışan, söylediklerimi net şekilde duymuş ve göz temasıyla da tepki vermişti.\r\n\r\nParayı çektikten sonra bu şekilde bir savunmayla karşılaşmak, müşteri olarak kendimi kötü ve değersiz hissettirdi. Bu tavır, hem iletişim hem de hizmet açısından ciddi bir problem yaratmaktadır.\r\n\r\nYaşadığım bu durumun tarafınızca değerlendirilmesini ve benzer sorunların başka müşterilerin başına gelmemesi adına gerekli aksiyonların alınmasını talep ediyorum.',1,3,9,13,3,NULL,'2025-06-20 16:25:32','2025-07-16 09:43:49',NULL,NULL,'Avm ortamında artan kalabalık, yetersiz oksijen, içeride bulunan şelale sesi, gürültü şeklinde olan insan sesleri ve led ışıklar, alışık olmayanlar içimn yorgunluk, avm çalışanları içinse gerginlik durumu yaratmaktadır. Ve misafirlerin sabırsız davranmalarına ve saygı sınrlarını aşan söylemlerine neden olmaktadır..','Personeller, turist misafirlerin çok olması  ve değişen misafir portföyünden dolayı her gelen misafire detaylı olarak menüyü anlatmaktadır. Bu durum yemek servis sürecinde yavaşlamaya, misafirin kararsızlık yaşayıp süreci uzatmasına neden olmaktadır. Özellikle Ukrayna, Rusya, Arabistan kökenli misafirlerimiz fazla olmakta ve birçoğu İngilizce\'yi tam konuşamamakta, anlayamamaktadır. İran asıllı personelimiz var; ancak kendisi doğal olarak tüm misafirlere yetişememektedir. Buradaki anlaşmazlık sadece iletişim değil, yabancı uyruklu misafirlerin yemekleri koltuklara dökmeleri, personelin kalkan masa arkasından ciddi bir temizlik sürecine girmelerine  ve psikolojik olarak yorulmalarına neden oluyor, bu durum aslında son zamanlara özel bir durum değil, süregelen durumun duygusal sonuçlarıdır..','Tezgahtar kadromuzun 2 kişi eksik olması nedeni ile, servis personelleri yeterli tecrübeye sahip olmamakla birlikte tezgah ekibine destek olmaktadır. Tecrübe ve bilgi eksikliği nedeni ile stres yaşamakta ve bu nedenle anlık alması gereken aksiyonları alamamaktadır. Dış destek olarak personel gelmekte; ancak tüm detaylara hakim olmadığı için lineer giden misafir memnuniyeti zaman zaman sekteye uğrayabilmektedir..','Personellerin yorgunluk nedeni ile beyin sisi yaşaması.','Yoğunluk esnasında bilgi akışında aksaklık yaşanması..','2025-07-30 00:00:00','Personellerimizi ekstra dinlenmesine destek oluyoruz, molaları gün içerisine yayıyor, çok zorlandıkları durumlarda ise hava almaya yönlendiriyoruz. Personel ile bire bir görüşmelerimizi artırdık, bireysel bazda geribildirimlerimizi artırdık. \r\n\r\nTezgaha destek olan servis personellerine ürünler ve detaylar ile ilgili eğitim verilip, tutanak tutuldu. İlave olarak servis personelleri gözlem altına alındı, anlık durumlarda anlık olarak yöneticiler müdahale etmeye başlandı. \r\n\r\nPersonellerin çalışma alanının sık olarak değişimine başladık, ne sürekli serviste ne de misafirle iletişim halindeler, yerlerini değiştirerek mental yorgunluğun önüne geçmeyi planlamaktayız. \r\n\r\nKadrolu personeli yoran temizlik işlerimizi, destek gelen personeller aracılığı ile çözmeye başladık. \r\nTemmuz ayı sonuna kadar ise kadromuzu tamamlamayı planlamaktayız. ',NULL,'website','2025-06-20 00:00:00'),(25,'MU-ZO-DU-MU-002','Zorlu Misafir Geri Bildirimi','İki latte alamadık bıkkın bir ifadeyele kasanın biri diğerine gittğimiz diğer kasa ilkine gönderdi. Hani çok mu kalabalık değil elinde siparişler varmış. İki kahvenin ödemesini almak bu ladar zor olmamalı . Starbucks aşağıda siparş almak için gözüne bakıyorlar. Teşekkürler + plus kitchen uğraşınız için kahvemizi sizden içemedik',1,3,6,11,3,NULL,'2025-06-23 08:58:40','2025-06-25 09:46:36',NULL,'2025-06-25 09:46:36','Kasalar arası koordinasyon eksikliği','Barista alanında sabit barista olmaması ve sürekli farklı personellerin o alana geçmesi','Barista kasasının sürekli arızalı olması ve o sebeple siparişlerin diğer kasaya yönlendirilmesi','Müşteri ile iletişim eksikliği','','2025-06-30 00:00:00','Barista kasası çok sık arızalandığı için sipariş için gelen misafirler ana kasaya yönlendiriliyor, Ana kasada yoğun olduğu zamanlarda misafir bekletilmemek için  Barista kasasına yönlendiriliyor. Bu gibi durumlarda koordinasyonun daha sık sağlanması için Kasa arızası sebebiyle misafir diğer kasaya yönlendirilirken misafire kibarca bilgilendirme yapılıp ilgili personelin eşliğinde diğer kasaya yönlendirme yapılcak şekilde operasyonel işleyiş eğitimi personellere verilecektir.. Mağaza yöneticisi Kasa arıza durumlarında mevut personellere bilgi geçip süreci takip edecek. Norm kadroya Barista eklediğimizde Bar alanındaki sipariş alım ve misafirle iletişim konularını daha ön planda tutup müşteri memnuniyeti ve önerili satışı arttırmayı hedeflemekteyiz. Barista kasasındaki sorunlar sürekli destek talebi açmamıza karşı çözüme kavuşturulamadı. Her ne kadar duruma farklı önlemler alıp riski minimuma indirmeye çalışsakta en garanti çözüm kasaların stabil çalışacak seviyeye getirilmesidir. Personellere genel müşteri iletişimi eğitimi ve  Standart operasyon prosedürleri ile ilgili eğitim verilecektir. ',NULL,'website','2025-06-23 00:00:00'),(28,'MU-GA-DU-MU-001','İstinye Google Misafir Geri Bildirimi ','Gittikçe küçülen porsiyonlar dışında herşey iyi. Ama bu kadarda küçülmez kuş mu besliyorsunuz',1,3,6,13,3,NULL,'2025-06-23 10:11:42','2025-06-26 14:28:52',NULL,'2025-06-26 14:28:52','Destek personelin porsiyonu ayarlayamaması. ','Personellerin yoğunluk ve acele ile yanlış yapması.','.','','','2025-06-25 00:00:00','Destek personellere porsiyonlama eğitimi verildi. Kadrolu personeller, destek personellerin hazırladığı tabakları kontrol edip, onay vermektedir. ',NULL,'google','2025-06-23 00:00:00'),(32,'MU-GA-DU-MU-002','İstinyepark Instagram Misafir Zehirlenme Şikayeti','Merhaba dun istinye parktaki subenizdeysim tavuklarncok koyydu asiri isitiyirlar ve eksimisti tavuk. tavuk cok kotuydu lahana mayonez bozuktu icindeki mantar vardi patatesle onlarsa hepsi eski urun gibiydu ya da fazla isitmislar. uyuyamadim mide agrisindan',1,3,6,13,3,NULL,'2025-06-23 11:37:26','2025-06-25 17:55:25',NULL,'2025-06-25 17:55:25','Yapılan tadım ve testler sonucu ürünlerin ısınma süresinde ortak karar verildi. Bazı misafirler yemeklerini daha ılık tercih ediyor. Isınma süresi kişisel deneyim olarak fazla gelmiş olabilir. ','Açılan her map içerisinden minik bir parça tadım ve duyusal diğer testler yapılmaktadır. Ürünlerin ekşimesine ihtimal veremiyoruz; ancak misafirimizin damak zevkine uymamış olabilir, özellikle coslow ürünü dışarıda çok daha fazla mayonez kullanılarak yapılmaktadır, bizim ürünümüz daha yoğurt bazlı olduğu için ekşi olarak algılamış olabilir. ','Puls Kitchen\'ı tanıyan misafirler, bu tarz durumları önemsediğimizi bildiği için, en ufak bir durumda ikram ürün istemekten çekinmiyor ya da \'\'Sadece bana uymadı.\'\' diyerek beğenmediği ürün yerine menünün tamamını değiştirmek istiyor. ','Bu portföy üzerinde şubemizde hiçbir olumsuz geri dönüş almadık. Misafirimiz yanıltıcı yorum paylaşıyor olabilir.','','2025-06-25 00:00:00','Coslow, Kuru Domatesli Baby Patates, Kremalı Mantarlı tavuk bugün dahil tezgahtadır, ürünlerin tadımı yapıldı ve duyusal kontroller gerçekleştirildi. Herhangi bir olumsuz duruma rastlanılmadı, misafirlerimizden de bu ana kadar olumsuz dönüş alınmamıştır. ',NULL,'diger','2025-06-22 00:00:00'),(33,'MU-SU-DU-MU-002','Suadiye Bowl & Wrap Yemeksepeti Misafir Geri Bildirimi ','seçtiğim yan ürünler değil de kafanıza göre koymuştunuz. tavuk buz gibiydi. noodle yapmayın bence:)',1,3,4,8,3,NULL,'2025-06-24 10:51:37','2025-07-02 11:24:00',NULL,NULL,'yemek sepeti sisteminin entegrasyonun sağlanamaması','paneller','personel dikkatsizliği','','','2025-07-02 00:00:00','ürünlerimizin daha sıcak ve doğru şekilde paketl