25 tarihinde şubenin en yoğun saatinde 1 saat arayla iki kere şalter atmıştır. En kısa sürede aksiyon alınmasını rica ediyoruz.',4,1,9,35,19,NULL,'2025-07-10 12:37:06','2025-07-18 17:07:16',NULL,NULL,'Şartel atması','sorunun dolapta olabileceği düşünüldü servis yönlendirildi ancak dolapta sorun bulunamadı.','binada yapılan elektrik  tadilatından haberimizin olamaması','','','2025-07-18 00:00:00','1 kez teşvikiye elektirik destek olmuş ancak sorun bulunamamıştır. Mevcut sorun için dolap motoru ses yapıyor dendi bu arızalı olup sartel attırıyor olabilir diye  dolap ustasınıda projeye gönderdik oda baktı 2. aksiyon olarak. 3. aksiyon olarak Elektrik mühendisi gönderdik oda binada 1,5 ay önce komple elektrik saatlerinin yenilenmiş ve yeni hat kablo çekim işlemi yapılmış olduğunu aktardı.\r\nBizim saatimiz ve hattımız yenilenmediği için bize ve anadolu hisarı ekibimizede kimse bilgi verilmediğinden süreç çözümü keşfinin zor yapılmış olmasından dolayı uzamıştır. 17.07.2025 tarihinde yeni hat çekilerek işlem tamamlandı.',NULL,NULL,NULL),(70,'AL-BE-ON-DI-001','Yabancı Madde (fiziksel tehlike)','Plus Tezgah Ürünü olan Kara buğday salatasından uğur böceği çıkmıştır. uğur böceği direk müşteri tabağından çıkmıştır. müşteri şikayetine sebep olmuştur.',2,8,3,31,24,NULL,'2025-07-10 13:14:33','2025-07-16 13:26:57',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(71,'SU-GA-ON-IC-001','merkez satın alma siparişleri hk;','Burak Bey Merhabalar,\r\nkalite denetimleri öncesi ve sonrası aldığımız aksiyon planlamalarında da yer alan ve talep ettiğimiz siparişler konusunda satın alma  süreçleri ile alakalı maillerde geri dönüşler alamamaktayız.\r\nKonu hakkında desteklerinizi rica eder iyi çalışmalar dilerim.\r\n\r\nMesut YILDIZ.',2,1,3,32,17,NULL,'2025-07-12 19:14:47','2025-07-16 13:28:07',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(72,'MU-ZO-DU-MU-005','Zorlu Web Site Misafir Geri Bildirimi/ Personel Hk. 2. Şikayet','19 gibi zorlu mağazasından menü aldım 600 liralık . Ama içinde neler var bilgi verilmedi sormama rağmen . Yardımcı olunmadı köfte ve hardallı patatese 600 lira verdim . Menü konusunda yardımcı olunmadı. Doymadığım bir yemeğe 600 lira verdim .birdaha gitmem . İlgili personel yok maalesef',1,3,6,11,3,NULL,'2025-07-14 11:16:50','2025-07-21 13:58:42',NULL,'2025-07-21 13:58:42','menü bilgilendirmesinin yetersiz olması','personelin ilgisizliği ve eğitimsizliği','kriz anında müşteri  iletişim eksikliği','','','2025-07-31 00:00:00','Öncelikle yaşadığımız en önemli olumsuzluk menü bilgilendirmesinin yetersiz olmasıdır. menüde sadece tam menünün açıklaması mevcut olup hafif menüde misafirlerimizin kafası karışmaktadır. bununla ilgili bölge müdürümüze ve operasyon müdürümüze gerekli bilgilendirme yapılarak menü bilgilendirmesinin gerekirse değiştirilmesini ve daha açık olmasını talep edeceğiz. daha önce aldığımız sikayetler üzerine e noktadan tanımlanan eğitimleri bitirerek personellerimize eğitim verilecektir.',NULL,'website','2025-07-08 00:00:00'),(73,'MU-AC-DI-MU-001','Acarkent Kahvaltı Saati Hk. Misafir Geri Bildirimi','Hafta sonu omlet saat 13:30 da kapanıyor. Saati uzatsanız çok memnun oluruz. Buradaki arkadaşlar omleti güzel yapıyor ama hep 5 - 10 dk ile kaçırıyoruz. Tesekkürler',3,3,6,6,3,NULL,'2025-07-14 11:43:36','2025-07-16 13:29:42',NULL,'2025-07-16 13:29:42',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'website','2025-07-13 00:00:00'),(74,'MU-IS-DU-MU-002','İstinye Web Site Misafir Geri Bildirimi/ Tepsiler Hk. 2. Şikayet','Eşim ve ben restoraninizda yemek yemiştik fakat 4 yasinda oğlumuza yandaki sulu yemek dukkanindan almıştık.Yemegimiz bittikten sonra diğer restoranın tabaklari ile karismasın diye tepsiyle kendim ayirdim çünkü diger restoranın tepsisini kendim verecektim fakat sizdeki görevli arkadaş yemegimizin bitmesinide beklemeden diğer restoranın tepsisini götürürmusunuz diye bizi uyardı. Zaten götürücek olmamiz dışında bu şekilde uyarilmakta beni rahatsiz etti. Eşimle ikimiz sizin restoranınızda yemiştik zaten cocugun bizden ayri bir masada mi oturmasi gerekiyordu farklı restorandan alindi diye? Bu sekilde bir uyarinin hos olduğunu düşünmüyorum yemegin sonundaki bu uyari orda yaşadığım deneyimi tersine çevirdi.',1,3,9,13,3,NULL,'2025-07-14 11:47:19','2025-07-17 17:52:43',NULL,NULL,'Destek gelen personellerin Plus kültürüne hakim olmaması ve iletişim dilini yanlış kullanması,','Mevcut personelin kendini ifade etme konusunda yetersiz olması,','Gelen misafirlerin sosyo ekonomik ve psikolojik sorunlarının oluşu.','','','2025-07-31 00:00:00','Şubemiz hakkında son zamanlarda gelen şikayetler sonucunda şubemiz personelleri ile ilgili başlattığımız dinlendirme, eğitim programlarımız devam etmektedir. Personellerimizi hem haftalık programlarda dinlendiriyor, onlara psikolojik destek sağlıyoruz. Aynı şekilde misafirlerimizinde alınganlık yapabileceğini düşünüp,  tepsi konusunda uyarı yapmama kararı aldık. Şubemiz girişini koyduğumuz \'\'Dışarıdan Yiyecek İçecek getirmek yasaktır.\'\' şeklinde uyarı levhası bu tür olayların oranını azaltmaya başlamıştır. Temmuz ayı sonuna kadar gözlem yapılmaya devam edilecektir. ',NULL,'website','2025-07-12 00:00:00'),(75,'MU-SU-DI-MU-001','Suadiye Google Misafir Geri Bildirimi/ Servis Hızı Hk. ','Egg\'s benedict ve peynirli menemen denedik. İkisi de oldukça lezzetliydi. Fakat hizmet çok yavaş. Mekanın atmosferi güzel, çok fazla çalışan var. Ama o kaşar çalışan olmasına rağmen servis çok yavaş. Egg\'s benedict kızarmış ekmek üzerine pose yumurta ve avakoda konulacak yani gelmesi 45 dk falan sürdü. Onun dışında lezzet ve atmosfer iyi, fiyatlar da ortalamanın bir tık üzeri sanki',4,3,3,8,3,NULL,'2025-07-14 14:49:43','2025-07-17 16:41:07',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(76,'MU-SU-DU-MU-011','Suadiye Google Misafir Geri Bildirimi/ wifi kullanımı hk.','WiFi bile yok bune biçim hizmet sakın böyle tekrarlı şeyler söylemeyin Bi süre sonra gelmiyorlar. Yemeklerde biraz tat kaçırmışlar yani pek kötü ve kişi başı 289 TL ödüyorsunuz.',1,3,6,8,3,NULL,'2025-07-14 15:07:11','2025-07-16 13:32:21',NULL,'2025-07-16 13:32:21',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(77,'MU-ZO-DU-MU-006','Zorlu Google Misafir Geri Bildirimi/ Personel Davranışları Hk.  ','Çalışanların ilgisiz ve özensiz davranması nedeniyle bir daha tercih etmeyeceğim bir işletme. Diğer şubelerinden aldığım hizmet oldukça farklıydı pozitif anlamda…',1,3,9,11,3,NULL,'2025-07-14 15:20:32','2025-07-18 15:22:39',NULL,NULL,'Personel eğitim yetersizliği','Yeni başlayan personel sayısının fazla olması','Personel eksikliği veya vardiya planlaması yetersizliği','','','2025-07-31 00:00:00','Tüm personele hizmet kalitesi ve müşteri ilişkileri eğitimi verilecek. Mağaza norm kadrosu tam, vardiya planlamasını kontrol ettiğimizde bir eksiklik gözlemlenmemiştir. Şikayetin geldiği haftanın haftalık vardiya planlaması paylaşılacaktır.  Yeni başlayan personelleri tecrübeli personellerle eşleştirip oryantasyonunu hazır olana kadar daha geri planda vermeye çalışsakta gün içerisinde mola saatlerinde anlık bu düzen bozulabiliyor. Mola planlaması yaparken bu düzeni olabildiğince devam ettirmek için daha hassas planlama yapılacak.',NULL,NULL,NULL),(78,'MU-ZO-DU-MU-007','Zorlu Google Misafir Geri Bildirimi/ Duyusal','Porsiyonlar çok küçüktü, patateslerin tadı bozulmuş gibiydi.',1,3,3,11,3,NULL,'2025-07-14 15:22:51','2025-07-16 13:33:29',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(79,'MU-SU-DU-MU-012','Zolru Bowl yemeksepeti geri bildirimleri/ hatalı teslimat','-Söylediğim soslar ve seçtiğim 4 garnitür ve meze eklenmemiş. Ürünler olmaması durumunda haber verilmesini söylemiştim ama parasını aldığınız ürünleri eklemeden göndermişsiniz (4.07.2025)\r\n\r\n-Seçimlermin 1-2 tanesi eklenmişti. Muhtemelen bittiği için ekleyemediler ama o zaman appde kapatın da insanları umutlandırmayın. Hayal kırıklığına uğradım (10.07.2025)',1,3,9,11,3,NULL,'2025-07-16 09:39:30','2025-07-21 08:50:11',NULL,NULL,'sipariş kontrol sürecinin yetersizliği','stok takibi ve uygulama arasında senkron eksikliği','eksik ürünlerde misafirle iletişime geçilmemesi .','','','2025-07-31 00:00:00','Tüm tezgahtar arkadaşlarımızla stok takip online panellerde açma kapama işlemlerini ve eksik olan ürün olduğunda şube sorumlularına haber verilmesi gerektiğini belirten bir eğitim vererek takibini sağlayacağız. bowl kısmına sorumlu atayarak genel olarak tek bir kişinin orda kalmasını sağlayacağız.',NULL,'yemeksepeti','2025-07-10 00:00:00'),(80,'MU-SU-DU-MU-013','Suadiye Bowl & Wrap Yemeksepeti Misafir Geri Bildirimi/ İkram Ürünleri Hk.','Dürüm çok güzeldi ancak yanındaki ikramları enginar kılçıklıydı, yoğurtlu buğday salatası ile fazla ekşiydi.',1,3,3,8,3,NULL,'2025-07-16 10:05:57','2025-07-16 15:25:56',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'yemeksepeti','2025-07-12 00:00:00'),(81,'MU-AN-DU-MU-002','Hisar Yemeksepeti Misafir Geri Bildirimi/ Beypazarı Sarma Hk. ','Beypazarı kurusu maalesef sertti. Sert sarma sevenler sevebilir ama ben beğenmedim. İç harcını da beğenmedim. Limon konulmasını beklerdim o da yoktu :(',1,3,3,31,3,NULL,'2025-07-16 10:11:01','2025-07-16 13:36:14',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'yemeksepeti','2025-07-12 00:00:00'),(82,'MU-SU-DU-MU-014','Suadiye Bowl & Wrap Getir Yemek Misafir Geri Bildirimi/ Eksik Ürün Gönderimi','Çatal bıçak ıslal medil vs hiç bir şey yollanmadı.\r\n',1,3,3,8,3,NULL,'2025-07-16 10:24:17','2025-07-17 13:24:55',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'getir','2025-07-14 00:00:00'),(83,'MU-SU-DU-MU-015','Suadiye Bowl & Wrap Trendyol Yemek Misafir Geri Bildirimi/ Bozuk Ürün Hk.','Fesleğenli köz patlıcan ve ızgara sebzeler kötü olmaya başlamış. bu fiyata ayıptır yahu bozulmaya yüz tutmuş ürün göndermek.',1,3,3,8,3,NULL,'2025-07-16 10:40:11','2025-07-23 12:49:45',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'trendyol','2025-07-11 00:00:00'),(84,'AK-GA-DU-DI-002','EURO FRESH','AMBALAJI AÇILDIĞI ANDA YOĞUN VE AĞIR BİR KÖTÜ KOKU İLE KARŞILAŞILMAKTA'