keti görülmemiştir. Soğuk hava deposunda tahta palet üzerine Karton koliler koyulduğu görülmüştür. * Soğuk hava deposunda bulunan açılmış mayonez kovasının dış kısmında kirlilikler olduğu görülmüştür. * Mal kabul cep depoda, kolilerin parçalanma şeklinde açıldığı görülmüştür. Sarf depo alanında, duvarla ile temas eden ürünlerin olduğu görülmüştür.  ',1,1,2,36,44,NULL,'2025-07-23 10:19:32','2025-07-23 10:19:32',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(100,'MU-ZO-DU-MU-008','Zorlu Yemek Isıtma Problemi Hk. Misafir Geri Bildirimleri/ Google','1. Yiyecekler sonradan ısıtıldığı için malesef kuru, köfteler aşırı pembe ve kuru, yoğurtlu ürünlerde ekşilik var.\r\n\r\n2. Köfte pek iyi pişmemişti ve içinde mantar olduğu belirtilmesine rağmen yoktu. Fırın patatesi beğendim, mezeler de iyiydi. Ancak yemeklerin ısıtılması konusunda daha özenli olabilirler mikro dalga çok kurutuyor malesef',1,3,2,11,3,NULL,'2025-07-23 12:33:37','2025-07-23 12:33:37',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'google','2025-07-22 00:00:00');
