INSERT INTO `thank_you` VALUES (1,'Yemeksepeti/ Personel','çalışan çok ilgilendi teşekkürler',3,3,'2025-06-17 10:38:03',1),(2,'Kanyon Google Teşekkür Yorumu','Yiyecek konusunda hem çok titizler hemde çok lezzetliler çalışanların hepsi güler yüzlü ve çok ilgililer kanyon şubesi her Konuda çok iyi',5,3,'2025-06-18 10:55:32',1),(3,'17.06.2025 Yemeksepeti- Caddebostan Mezze Yorumları','-Leziz\r\n-yemekler cok basarılı\r\n-herzaman ki gibi muhteşem di\r\n-Çok lezzetli ve ikram için teşekkürler',9,3,'2025-06-19 09:16:16',1),(4,'Kanyon Google Misafir Olumlu Geri Bildirimleri','-Her zaman taze ve güzel çeşitler; emeklerinize teşekkürler.\r\n\r\n-Çalışanları çok tatlı ve yardımcı, öğlen yemeklerimizin vazgeçilmezi',5,3,'2025-06-20 09:40:11',1),(5,'Google Prototype Olumlu Misafir Geri Bildirimi','Yemekler oldukça lezzetli ve doyurucu',22,3,'2025-06-20 09:46:37',1),(6,'Caddebostan Mezze Google Olumlu Misafir Geri Bildirimi ','Selin Hanima ilgisi, muthis enerjisi ve guleryuzu için teşekkür ederiz.',9,3,'2025-06-20 09:48:59',1),(7,'Suadiye Google Olumlu Misafir Geri Bildirimi ','Kendi bowlunu oluşturabilmek çok güzel, özellikle vegan bir çok seçenecek mevcut',8,3,'2025-06-20 09:51:41',1),(8,'Prototype Google Teşekkür Yorumu','Ben Mengenliyim. Beş yıldızlı birçok otelin mutfak şefini tanırım. Bu hafta Prototype 2 de sabah kahvaltısı yaptım. Hanım Şefin hazırladığı omlet o kadar mükemmel idi ki, öyle bir omleti 5 yıldızlı otellerde yemedim. Teşekkürler Prototype 2. Teşekkürler Hanım Şef.',22,3,'2025-06-23 07:06:32',1),(9,'Zorlu Google Teşekkür Yorumu','çok güler yüzlü bir hizmet aldığımı söyleyebilirim, yemekler çok taze ve ürünler lezzetliydi.',11,3,'2025-06-23 07:18:23',1),(10,'Hisar Mezze Google Yorumu','Her gittiğimizde güler yüzlü çalışanlar sayesinde alışverişimizi yapıp mutlu ayrılıyoruz:) Mezelerin tadı hep güzel vehep taze ✨',10,3,'2025-06-24 07:06:00',1),(11,'Caddebostan Mezze Yemeksepeti Teşekkür Geri Bildirimleri','Yediğim her şey çok iyi ?? ellerinize sağlık\r\n\r\nİkram için teşekkürler her sey çok lezzetliydi\r\n\r\nTüm mezeler çok lezzetliydi, elinize sağlık :)',9,3,'2025-06-24 08:04:50',1),(12,'İstinye Google Teşekkür Geri Bildirimleri ','-Gayet güzel bir deneyimdi çalışanlar kibardı, yemekler lezzetliydi ve çay ikramı vardı yalnız yaprak sarmadan 3 değil de 5 tane olsa menüde süper olurdu\r\n- İlgi alaka ve lezzetli sağlıklı yemekler icin ilk tercih sebebi\r\n- Kendi tabağını kendin oluşturduğun bir restoran, sağlıklı yiyecekler bulabiliyorum severek tercih ediyorum.\r\n-Yemekler güzel ve kaliteli, fiyat/performans diğer seçeneklere göre yüksek. Çay ikramı da var :)',13,3,'2025-06-26 12:03:09',1),(13,'Hisar Google Teşekkür Geri Bildirimleri','-Birkaç çeşidini denedik ve hepsi birbirinden lezzetliydi. Tekrar gelip diğer mezelerden denemek için sabırsızlanıyorum. İşletme sahibi beyefendi de çok kibardı, kendisine teşekkür ederiz.\r\n- Oldukça lezzetli ve çeşitli mezeler sunuyorlar. Biz çok beğendik.. Çok teşekkürler ellerinize sağlık ☺️\r\n',10,3,'2025-06-26 12:11:15',1),(14,'Suadiye Google Teşekkür Geri Bildirimleri ','-Sağlıklı yemek için her zaman tercih ettiğim bir yer olmuştur ancak bu şubesine ilk kez gittim atmosfer güzel masa düzeni rahat. Çalışanlar oldukça ilgili kibar ve güleryüzlüler.Somon menüleri lezzetli doyurucu. Cadde de sağlıklı bişeyler mi yesek ne yesek dediğinizde bence akla gelecek yerlerden biri tavsiye ederim.\r\n\r\n- Öncelikle restoran temizliği ve personel hizmeti standartların çok üzerindeydi. Yemekler için Ballı Hardallı Tavuk aşırı iyiydi ?\r\n',8,3,'2025-06-26 12:16:06',1),(15,'İstinye Google Teşekkür Geri Bildirimleri','-Gayet güzel bir deneyimdi çalışanlar kibardı, yemekler lezzetliydi ve çay ikramı vardı yalnız yaprak sarmadan 3 değil de 5 tane olsa menüde süper olurdu\r\n-İlgi alaka ve lezzetli sağlıklı yemekler icin ilk tercih sebebi\r\n- Kendi tabağını kendin oluşturduğun bir restoran, sağlıklı yiyecekler bulabiliyorum severek tercih ediyorum.\r\n- Yemekler güzel ve kaliteli, fiyat/performans diğer seçeneklere göre yüksek. Çay ikramı da var :)',13,3,'2025-06-26 12:49:26',1),(16,'Zorlu Bowl Google Teşekkür Geri Bildirimleri ','-Pancarlı humus efsane! Kinoa, edameme ve meksika fasulyesini de çok sevdim. ??\r\n\r\n-Normalde yorum yazmiyorum ama her siparisim kusursuzdu size yazmak istedim, cok tesekkur ediyorum oldukca lezzetliydi yine, Ikram shot icinde ayrica tesekkurler.',11,3,'2025-06-27 08:03:46',1),(17,'Hisar Yemeksepeti Teşekkür Geri Bildirimleri','-Vişneli enginara bayıldım yok böyle bir lezzet\r\n-İki ürün de çok lezzetliydi.',10,3,'2025-06-27 09:12:56',1),(18,'İstinye Google Teşekkür Geri Bildirimi ','-Senelerdir geldigimiz yer. Yemekler saglikli ve cok lezzetli. Calisanlar guler yuzlu. Gelmeye devam edecegim\r\n-Yemekler ve menu opsiyonu guzel. Saglikli alternatif olarak basarili. Fiyat cok ucuz degil.\r\n-Cok lezzetli ve bolca secenek var\r\n-İyi\r\n',13,3,'2025-06-30 06:23:25',1),(19,'Yemeksepeti Racoon Burger Teşekkür Geri Bildirimi','-Canım hamburger istediğinde sadece buradan söylüyorum artık inanılmaz bir lezzet ekmeğinin de hastasıyım\r\n-Muhteşem lezzeti , her siparişte aynı servis kalitesi ile önceki yorumumuz değişmedi , bölgedeki en iyi burgerci şu anda.',8,3,'2025-06-30 08:33:41',1),(20,'Google Kanyon Teşekkür Geri Bildirimi','Çalışanları çok güler yüzlü çok kibar ve yardımseverler. Limonlu cheesecake ve latte bağımlısıyım ikidir gelip bunları yiyorum çok lezzetli yapıyolar diğer ürünlerini de kesinlikle denemem lazım iyi ki keşfetmişim burayı diyorum\r\n',5,3,'2025-07-01 13:42:30',1),(21,'Suadiye Google Teşekkür Geri Bildirimi','Yemekler her geldiğimde çok taze ve lezzetli oluyor ve oldukça doyurucu. Kesinlikle caddede sağlıklı bir yemek yiyebileceğiniz mükemmel bir yer. Ayrıca çalışanların güleryüzü ve ilgisi bizi çok memnun etti. Mutlaka gidin :)))',8,3,'2025-07-01 14:11:28',1),(22,'Allianz Şube Teşekkür Geri Bildirimi','Merhabalar,\r\nWegathon etkinliğimiz kapsamında, özellikle catering sürecinde göstermiş olduğunuz değerli destek ve hızlı aksiyonlarınız için en içten teşekkürlerimizi sunarız.\r\n\r\nBaşta Ali Bey ve Hüseyin Bey olmak üzere, tüm Plus Kitchen çalışanlarının her aşamada gösterdiği çözüm odaklı yaklaşım ve işbirliği, etkinliğimizin başarısına önemli katkılarda bulunmuştur.\r\n\r\nHer konuda hızlı ve profesyonel destek sunduğunuz için memnuniyetimizi özellikle belirtmek isteriz. Umuyoruz ki önümüzdeki projelerde de birlikte çalışmaktan aynı keyfi almaya devam ederiz.\r\n\r\nEkibim ve Enuygun adına tüm Plus Kitchen ekibine teşekkür ederiz.\r\n\r\nSevgiler,',21,3,'2025-07-14 07:44:00',1),(23,'Allianz / Engin Grup Teşekkür Geri Bildirimi','Hüseyin Bey Merhaba,\r\nÖncelikle, tüm bu süreçte göstermiş olduğunuz destek, ilgi ve anlayışınız için size ve değerli ekibinize içtenlikle teşekkür ederiz. Her şey mükemmel ve kusursuz bir şekilde ilerledi.\r\nSaha ve ofis ekiplerimizden son derece olumlu geri dönüşler aldık. Bu başarılı iş birliğinin önümüzdeki süreçte de aynı şekilde devam etmesini içtenlikle temenni ederiz.\r\n',21,3,'2025-07-14 07:47:20',1),(24,'Genel Teşekkür Geri Bildirimi','Suadiye ve Zorlu şubelerinizde yemek yiyorum. Her şey çok lezzetli. Vadi İstanbul’a da açılmanızı dört gözle bekliyorum. Etrafta çok fazla iş yeri var ve öğlenleri sağlıklı yemek arıyoruz. Orayı değerlendirmenizi isterim. :)',38,3,'2025-07-14 08:32:50',1),(25,'İstinye Google Teşekkür Geri Bildirimleri','-Plus Kitchen\'a uğradım ve gerçekten çok memnun kaldım! ?\r\nÇalışanlar genel olarak çok ilgili ve güler yüzlüydü, özellikle kasadaki hanımefendi inanılmaz nazikti, beni çok güzel karşıladı. Yemekler hem sağlıklı hem de çok lezzetliydi. Ortam da çok temiz ve hoştu.\r\nKesinlikle tekrar gelmek isterim, teşekkürler! ?✨\r\n\r\n-Tavuk yanında maç and cheese aldım meze olarak yaprak sarma ve yoğurtlu brokolili aldım hepsinin tadı çok güzeldi yaprak sarma vişneli olursa onu alın o çok iyi yemekten sonra çay da ikram ettiler asıl aklım yiyemediğim tatlılarında kaldı her şey nefis duruyordu',13,3,'2025-07-14 11:24:30',1),(26,'Hisar Google Teşekkür Geri Bildirimi','Bu muhitte temiz yemek bulmak zor, Plus kitchen o acigi dolduruyor. Fiyat performans ve lezzet olarak tatmin edici, calisan beyefendi de cok ilgili ve nazikti. Mutlaka tekrar gelecegim. Ayrica pancarli bir urun vardi onu tavsiye ederi',10,3,'2025-07-14 11:25:39',1),(27,'Emaar Google Teşekkür Geri Bildirimleri','-Yemek kalitesi ve tazeliğiyle beni etkileyen kafelerden biri oldu. Sunulan tabaklar sağlıklı, lezzetli ve açıkça organik malzemelerle hazırlanmıştı. Hizmet mükemmeldi; hızlı ve güler yüzlüydü, bu da ziyarete hoş bir dokunuş kattı. Mekân ise şık ve işlevsel bir tasarıma sahip olmasına rağmen biraz sıcaklık ve çekicilikten yoksundu. Buna rağmen, alışveriş merkezi içinde harika bir seçenek ve kesinlikle ziyaret edilmeye değer özel bir deneyim sunuyor.\r\n\r\n-Konsept, hizmet ve lezzetler çok güzel. Fiyat performans olarak her zaman tercih edilebilir, ayrıca yemek sonrası çay da ikram\r\n',4,3,'2025-07-14 11:28:48',1),(28,'Suadiye Google Teşekkürleri','-Yemekleri, mezeleri ve güler yüzlü personeli ile cadde de ki favori mekanımız. Tavsiye ederim\r\n-Her seyin guzel olmasinin yaninda triyaki somon ennn sevdigim oldu :)\r\n-Tum yemekler ve mezelerin cesitliligi, tadi cok guzel, tesekkurler\r\n-Yemekler, mezeler, içecekler ve ikramlar çok güzeldi çok memnun kaldık, fiyatını hakeden bir mekan. Çokça geldiğimiz bir yer. Fatih beye ilgisi ve alakası için çok teşekkürler.\r\n-Yemekler çok güzel. Enerji ve atmosfer harika! Özellikle güler yüzü ve samimiyetiyle ilgini eksik etmeyen Fatih Bey’e selamlar\r\n-Çok lezzetli, çalışanlar güler yüzlü :)\r\n-Çalışan arkadaşlar çok güleryüzlü, mekan ferah, yiyecekler taze ve lezzetli. Çok memnun kaldık teşekkür ederiz :)\r\n-Yemekleri ve mezeleri gayet lezzetli ve güncel piyasaya göre fiyatları uygun\r\nÇalışanlar çok ilgili ve güler yüzlü\r\n-Harika\r\n-her şey çok güzeldi\r\n-Tüm şubelerini çok severim ama Suadiye başkaoturunca kalkasım gelmiyor',8,3,'2025-07-14 11:37:00',1),(29,'Suadiye Bowl & Wrap Yemeksepeti Teşekkür Geri Bildirimleri','- bayildim!!\r\n\r\n- Porsiyonlar ve paketleme çok iyiydi\r\n\r\n- Bayıldımmmm\r\n\r\n- Bowllar çok leziz ve doyurucu, paketleme özenliydi. Tatlı ikramınız için de çok teşekkürler :)\r\n\r\n',8,3,'2025-07-16 06:59:39',1),(30,'Caddebostan Mezze Yemeksepeti Teşekkür Geri Bildirimi','-Her şey çok lezzetli ve tazeydi elinize sağlık',9,3,'2025-07-16 07:12:46',1),(31,'Acarkent Mezze- Yemeksepeti Teşekkür Yorumu','Yaprak sarmalar müthişti özellikle vişneli olana bayıldık tadı damağımızda kaldı',6,3,'2025-07-16 07:15:45',1),(32,'Plus Kitchen Restaurant-Yemeksepeti Teşekkür Yorumu','Yapmış oldukları işi ne kadar ciddi ve düzgün yaptılarını deneyimleyerek gördük.tatlılar için teşekkürler..',8,3,'2025-07-16 07:17:32',1),(33,'Getir Yemek- Hisar Teşekkür Yorumu','Ellerinize sağlık herşey mükemmeldi, paketlemeden tutun yemeklerin lezzetine kadar sanki evimizin mutfağından çıkmış gelmiş herşey.',10,3,'2025-07-16 07:25:36',1),(34,'Caddebostan Mezze- Getir Yemek Teşekkür Yorumu','6 adet meze siparişi verdim, hepsi çok taze ve lezzetliydi özellikle Fava ve Barbunya favorim\r\n',9,3,'2025-07-16 07:27:20',1),(35,'Caddebostan Mezze Trendyol Yemek Teşekkür Geri Bildirimleri ','-Gerçekten herşey çok lezzetliydi\r\n-Tüm siparişlerim özellikle vişne sarma süperdi ellerinize emeğinize sağlık ayrıca sunumunuz harika teşekkürler\r\n-Meze de sarma da çok lezeetliydi. Bir de yanında ikram olarak gönderilen kadınbudu köfte de şahaneydi. Ellerinize sağlık...\r\n-Mükemmel ????\r\n-iyi paketlenmis, lezzetli, zamaninda... yolunuz acik olsun',9,3,'2025-07-16 07:53:52',1),(36,'Suadiye Web Site Geri Bildirim Formu- Teşekkür','Çok beğendim',8,3,'2025-07-16 08:41:45',1),(37,'İstinye Google Teşekkür Yorumları','-Tatlıları taze ve çok lezzetli. Çok güler yüzlü nezaketliler, hizmet kalitesi çok iyi ??\r\n-Hızlı yemek yerken lezzetli ve saglikli da olabilmesi adına tercih ettiğim servisi ilgisi güzel mekan.',13,3,'2025-07-16 08:47:02',1),(38,'Kanyon Google Teşekkür Yorumları','-?\r\n-??\r\n-Yemekleri çok güzel kaliteli ve her gün farklı çeşit çıkartıyorlar. Çalışanların güler yüzü ve misafirperverliği çok iyi ☺️?',5,3,'2025-07-16 08:51:15',1),(39,'Acarkent Google Teşekkür Yorumları','-Bütün çalışanların eline emeğine sağlık hepsi çok güler yüzlü cana yakın mezeler ve yemekler her zaman taptaze sunumları iştah açtırıyor çok sevdiğim sağlıklı yemek restoranı diyebilirim mutlaka gelip bu atmosferde yemek yemenizi öneriyorumm????\r\n-karşılama çok iyiydi personeller güler yüzlü çok sıcak davranıyorlar misafirlere karşı ve ben bundan çok mutlu oldum mezeleri çok lezzetliydi artık herkese tavsiye ediyorum vaktim oldukça daha çok gitmeye çalışıyorum tüm personele çok teşekkür ediyorum\r\n-İçerisinin düzeni karşılama süper bayıldım :)\r\n-Kesinlikle favorilerim arasında olan bir yer. Çalışanların ilgisi, güler yüzü muhteşem. Mezeleri inanılmaz güzel yolunuz düşerse mutlaka uğrayın, emeğinize sağlık??',6,3,'2025-07-16 08:55:39',1),(40,'Acarkent Google Teşekkür Geri Bildirimi','Haftasonları Colesum’a yüzmeye geliyoruz kızım ve ben özellikle vişneli yaprak sarmalarını yemeden ve eve paket yaptırmadan dönmeyiz. Yemeklerin ve mezelerin hepsi taze ve lezzetli. Özellikle Derya Hanım ve diğer ekip arkadaşları çok güleryüzlü çocuklarla iletişimleri iyi memnun kaldığımız bir mekan. Teşekkürler Plus Kitchen :)',6,3,'2025-07-17 08:07:16',1),(41,'Suadiye Google Teşekkür Geri Bildirimi','Gittim yedim çıktım bu yorumu yapıyorum. Çalışanları müthiş ilgili ve doğru bilgilendirme yapacak kadar konuya hakim. Somon, vişneli sarma, zeytinyağlı bamya ve haşlanmış sebze yedim hepsi ayrı ayrı inanılmaz lezzetliydi. Caddede bir burger fiyatına sağlıklı beslenme fırsatı yaratmışlar. Atmosfer açısından aydınlatma ve oturma planı oldukça güzel kurgulanmış ve masaların birbirine olan mesafesi de gayet yeterliydi. Yeni Favori mekanım oldu.',8,3,'2025-07-17 08:10:48',1),(42,'Kanyon Google Teşekkür Geri Bildirimi','Ofisten çalışırken sağlıklı yemek yiyebilmemi sağlayan mekan. Sıra olan rush hour hariç hem hızlı hem sağlıklı güzel seçenekler oluyor',5,3,'2025-07-17 08:18:19',1),(43,'Zorlu Bowl- Yemeksepeti Teşekkür Geri Bildirimi','Çok güzel ve doyurucuydu, elinize sağlık. Parasının hakkını veriyor.\r\nSevgiler',11,3,'2025-07-18 05:59:16',1),(44,'Hisar- Getir Yemek Teşekkür Geri Bildirimi','hepsi çok güzeldi. zaten sürekli gidip orada da tadıyorum, çalışanların ilgisi çok güzel?',10,3,'2025-07-18 06:27:24',1),(45,'Caddebostan Mezze- Getir Yemek Teşekkür Geri Bildirimi','Siparişim hem çok hızlı hem de özenle hazırlanmıştı.Tüm yemekler gerçekten çok lezzetliydi. Yanında gönderi küçük ikram da çok güzeldi, teşekkür ederim.',9,3,'2025-07-18 06:29:18',1),(46,'Emaar Google Teşekkür Geri Bildirimi','Avm de yiyebilceginiz hem en saglikli hem de en lezzetli yemekleri burada bulabilirsiniz.',4,3,'2025-07-18 09:22:24',1),(47,'Zorlu Web Site Geri Bildirim Formu- Teşekkür Yorumu','Tertemiz güleryüzlü çalışanlar hijyenik her geldiğimde somon patates tercihim ??? tavsiye ederim',11,3,'2025-07-23 06:09:02',1),(48,'Kanyon Google Teşekkür Geri Bildirimleri','-Her seferinde bayilarak geldigim bi yer özellikle kubra hanim cok yardimci oldu saglikli secenekleriyle ve glutensiz tatlilariyla guleryuzle cok sevdigim bi mekan\r\n\r\n-gerek yemek için gerek bilgisayarımı alıp çalışmak için sürekli uğradığım bir mekan. çeşit çeşit yemekleri, her zevke uygun tatları ile vazgeçilmez bir yer. özellikle Kanyon şubesi çalışanları ve Kübra Hanım’a ilgilerinden dolayı teşekkür ediyorum.\r\n',5,3,'2025-07-23 06:34:51',1),(49,'Suadiye Teşekkür Yorumları','-Bowl, değişik salatalar ve köfte çok lezzetliydi. Yemekleri ve Servisi çok beğendim. Fiyatları gayet makul. Unsuz ve şekersiz tatlısını da çok güzeldi.\r\n-Çalışanlar arkadaşlarımız inanılmaz güler yüzlü ve kibar\r\n-Yemekler çok lezzetliydi, çalışanlar güler yüzlüydü ve kibardı. 10/10 mekan\r\n-Çalışan arkadaşlar çok güler yüzlü. İçeride çok doğal ve sempatik bir hava var. Tekrar gelecegiz',8,3,'2025-07-23 06:42:36',1),(50,'Zorlu Google Teşekkür Geri Bildirimleri','-Güler yüzlü servis, temiz vs hijyenik hizmet. Tavsiye ederim.\r\n-B a y ı l d I m',11,3,'2025-07-23 12:26:34',0),(51,'Zorlu Google Teşekkür Geri Bildirimleri','-Güler yüzlü servis, temiz vs hijyenik hizmet. Tavsiye ederim.\r\n-B a y ı l d I m',11,3,'2025-07-23 12:30:41',0);
